<!DOCTYPE html>
<html lang="ko">
<head>
    <meta charset="utf-8">
    <title>Export Chart</title>
    <style>
        @import url(http://fonts.googleapis.com/earlyaccess/notosanskr.css);

        * {
            box-sizing: border-box;
        }

        html, body {
            margin: 0;
            padding: 0;
            width: 100%;
            height: 100%;
            font-family: 'Noto Sans KR', sans-serif;

        }

        table {
            margin: 10px;
            width: calc(100% - 20px);
            border-collapse: collapse;
        }

        th {

        }

        tr:first-child td {
            color: #4C4C4C;
            font-size: 14px;
            font-weight: bold;
            border-bottom: 1px solid #aaaaaa;
            border-top: 1px solid #aaaaaa;
            height: 38px;

        }

        td {
            font-size: 14px;
            color: #6D6D6D;
            border-top: 1px solid #cecece;
            border-right: 1px solid #cecece;
            border-bottom: 1px solid #cecece;
            text-align: center;
            height: 36px;
        }

        td:last-child {
            border-right: none;
        }
        .btnA{
            padding: 10px;
            height: 60px;
            overflow: hidden;
        }
        .btn {
            margin: 5px;
            float: left;
            background: #5b606c;
            color: #FFFFFF;
            height: 30px;
            font-size: 12px;
            line-height: 1.5;
            border-radius: 1px;
            padding: 6px 10px;
            cursor: pointer;
            min-width: 66px;
            text-align: center;
            user-select: none;
        }
        .btn:hover{
            background: #46484E;
        }

        .btn.save {
            left: 90px;
        }
    </style>

            series.minFontSize=am4core.percent(data.minFontSize);
            series.labels.template.fill = am4core.color(data.color);
            series.labelsContainer.rotation = data.rotation;
            series.interpolationDuration = 0;
            if(data.autoColor){
                series.colors = new am4core.ColorSet();
                series.colors.passOptions = {};
            }
        }
        else{AmCharts.makeChart( "chartdiv", data); }}
    function save() {
        const items = data.dataProvider;
        const replacer = function (key, value) {
            return value === null ? '' : value;
        };
        const header = Object.keys(items[0]);
        let csv = items.map(function (row) {
            return header.map(function (fieldName) {
                return JSON.stringify(row[fieldName], replacer)
            }).join(',');
        });
        csv.unshift(header.join(','));
        csv = csv.join('\r\n');
        const url = decodeURI(location.pathname);
        const fileName = url.substring(url.lastIndexOf('/') + 1).split('.html')[0];
        saveAs(new Blob([csv], {type: 'text/plain;charset=utf-8'}), fileName.trim() !== '' ? fileName + '.csv' : 'amchart.csv');
    }
</script>
